   * @param \NicholasCreativeMedia\FedExPHP\Structs\RateRequest $rateRequest
   *   A rate Request object.
   *
   * @return mixed|string
   *   A simulated response based on the request.
   */
  public function getRates(RateRequest $rateRequest) {
    $authenticated = $rateRequest->getWebAuthenticationDetail()->getUserCredential()->getKey() == FedExKernelTestBase::TEST_KEY;
    $authenticated &= $rateRequest->getWebAuthenticationDetail()->getUserCredential()->getPassword() == FedExKernelTestBase::TEST_PASS;
