    $authenticated &= $rateRequest->getClientDetail()->getMeterNumber() == FedExKernelTestBase::TEST_METER_NUMBER;
    if (!$authenticated) {
      return $this->authenticationFailed();
    }

    /*TODO add more validation */
    return $this->allInOneResults();

  }

